    false,nt"url": null,nt"notes": "Converted in the fall of 1988 from USGS
    1:100,000 scale DLG data to ARC format. Since then, multiple and extensive corrections
    have taken place. Early on, several Arizona agencies were part of rectification
    including: attributes, features, edgematching and the re-tiling of the data into
    the USGS Hydrologic Unit Code (HUC) library tiling format. The Environmental Protection
    Agency (EPA) has since added critical attributes to the Arizona database, including:
    A nationally recognized management link code (the Reach Id), names, and hydrologic
    information. Arizona has enhanced the theme further by adding ergonomic Descriptive
